script:
reset();

const seed = 946270;
const size = 128;
const maxHeight = 32;
const offset = 64;
const radius = size * 0.5 - 0.5;
const simplex = new SimplexNoise(seed);

const map = [];
for (let x = 0, i = 0; x < size; x += 1) {
  for (let y = 0; y < maxHeight; y += 1) {
    for (let z = 0; z < size; z += 1, i += 1) {
      const baseHeight = (radius - Math.sqrt(
        (x - radius) ** 2
        + (z - radius) ** 2
      )) * 1.5;
      const height = Math.floor(
       (
          Math.abs(simplex.noise3D(x / 32, y / 24, z / 32)) * 0.3
          +  Math.abs(simplex.noise3D(x / 64, y / 48, z / 64)) * 0.3
          +  Math.abs(simplex.noise3D(x / 128, y / 64, z / 128)) * 0.4
        ) * Math.min(maxHeight, baseHeight)
      );
      map[i] = y <= height;
    }
  }
}

for (let x = 0, i = 0; x < size; x += 1) {
  for (let y = 0; y < maxHeight; y += 1) {
    for (let z = 0; z < size; z += 1, i += 1) {
      if (map[i]) {
        let type = 0;
        if (y <= 6) {
          type = 2;
        } else {
          const top = y === (maxHeight - 1) || !map[
            x * size * maxHeight + (y + 1) * size + z
          ];
          type = top ? 1 : 5;
          if (top && simplex.noise3D(x / 8, y / 4, z / 8) > 0.6) {
        	update(x - offset, y + 1, z - offset, 6);
          }
        }
        update(x - offset, y, z - offset, type);
      }
    }
  }
}

const elevator = {
  x: -4,
  y: 9,
  z: -4,
};
box(
  elevator.x, elevator.y, elevator.z,
  8, 9, 8,
  3
);
box(
  elevator.x + 1, elevator.y + 1, elevator.z + 1,
  6, 7, 6,
  4
);
box(
  elevator.x + 2, elevator.y + 2, elevator.z + 2,
  4, 5, 4,
  0
);
box(
  elevator.x + 3, elevator.y + 2, elevator.z,
  2, 4, 2,
  0
);
